issue.body:
I'm trying to execute Firestore queries inside of Google Cloud Functions utilizing Qwik together with `routeLoader$` in order to fetch and pre-render data server-side. Everything works fine in development and when using the preview command, but upon deploying the app to Firebase Hosting and Cloud Functions ([Using the Firebase integration](https://qwik.builder.io/docs/deployments/firebase/)), the app returns Error 500 - Internal Server Error.

Upon opening the Cloud Function logs, I can see, that it fails with the following error message which leads me to believe, that there is something wrong with the `@google-cloud/firestore` and `firebase-admin`(Which utilizes this package under the hood as far as I know):

```
TypeError: Cannot set properties of undefined (setting 'fromParams')
    at ClientPool.clientFactory (file:///workspace/server/assets/@qwik-city-plan-c264a646.mjs:167322:43)
